import { Component, Input, Output, ElementRef, Renderer, OnInit, EventEmitter } from '@angular/core';

@Component({
    selector: 'skscheckbox',
    template: `
        <span class="sks-checkbox" tabindex="{{tabIndex}}" (keydown)="keyDownEvent($event)" [ngClass]="{checked:!!model, disabled: isDisabled, readonly: readonly}"></span><span title="{{text}}">{{text}}</span>
    `,
    styles: [`
        .sks-checkbox:focus{outline: 0;}
        :host {
            display: inline-block;
            vertical-align: middle;
            height: 30px;
        }
        .sks-checkbox {
            position: relative;
            display: inline-block;
            width: 30px;
            height: 30px;
            vertical-align: top;
            margin-right: 5px;
            -webkit-border-radius: 5px;
            -moz-border-radius: 5px;
            border-radius: 5px;
            -moz-background-clip: padding;
            -webkit-background-clip: padding-box;
            background-clip: padding-box;
            border: 1px solid rgba(84, 47, 2, 0.35);
            background: rgba(255, 255, 255, 0.7);
            text-align: left;
            cursor: pointer;
        }
        .sks-checkbox:hover{
            box-shadow: 0 0 10px rgba(179, 97, 4, 0.4) inset;
        }
        .sks-checkbox + span {
            cursor: pointer;
            display: inline-block;
            width: calc(100% - 35px);
            width: -webkit-cacl(100% - 35px);
            width: -moz-cacl(100% - 35px);
            width: -o-cacl(100% - 35px);
            width: -ms-cacl(100% -35px);
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
            line-height: 30px;
        }
        .sks-checkbox.checked::after {
            position: absolute;
            content: '';
            width: 28px;
            height: 28px;
            background: url('data:image/png;base64,') -548px -140px;
        }
    `]
})
export class CheckboxComponent {
    @Input() model: boolean;
    @Output() modelChange: EventEmitter<boolean> = new EventEmitter<boolean>();
    @Output() onChange: EventEmitter<boolean> = new EventEmitter<boolean>();
    @Input() isDisabled: boolean;
    @Input() text: string;
    @Input() tabIndex: number;
    @Input() isNotClick: boolean;
    @Input() readonly: boolean;

    constructor(
        private element: ElementRef,
        private renderer: Renderer
    ) { }

    ngOnInit() {
        // this.renderer.setElementClass(this.element.nativeElement, 'inline-block', true);
        if (!this.isNotClick) {
            this.renderer.listen(this.element.nativeElement, 'click', (event) => {
                event.stopPropagation();
                if (this.isDisabled || this.readonly) {
                    return;
                }
                this.model = !this.model;
                this.modelChange.emit(this.model);
                setTimeout(() => {
                    this.onChange.emit(this.model);
                })
            });
        }
    }

    keyDownEvent(event) {
        if (event.keyCode === 32) {
            this.model = !this.model;
        }
        return true;
    }

}